      step: 1,
      email: '',
      code: '',
      password: '',
      userInfo: ''
    }
  },
  methods: {
    stepperNext() {
      // this.$refs.stepper.next()
      // console.log(this.step)
      switch(this.step) {
        case 1:
          this.codeSend();
          break;
        case 2:
          this.codeVerify();
          break;
        case 3:
          this.setPassword();
          break;
        case 4:
          this.$emit('hide-new-password');
          break;
      }
    },
    async codeSend() {
      // console.log("sendEmail", this.$store.state.user)
      const codeSend = await this.$store.dispatch('user/codeSend', {
        email: this.email
      })
      if(codeSend.success){
        this.userInfo = codeSend.data;
        this.$refs.stepper.next()
      }else{
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: codeSend.message,
          color: "negative",
        })
      }
    },
    async codeVerify() {
      const codeVerify = await this.$store.dispatch('user/codeVerify', {
        userId: this.userInfo.userId,
        code: this.code
      })
      if(codeVerify.success){
        this.$refs.stepper.next()
      }else{
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: codeVerify.message,
          color: "negative",
        })
      }
    },
    async setPassword() {
      //
      const updateUser = await this.$store.dispatch('user/updateUser', {
        userId: this.userInfo.userId,
        password: this.password
      })
      if(updateUser.success){
        this.$refs.stepper.next()
      }else{
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: updateUser.message,
          color: "negative",
        })
      }
    }
  },

};

