export default {
  data() {
    return {
      email: this.$store.state.user.info ? this.$store.state.user.info.email : '',
      msg: "",
      sending: false
    };
  },
  methods: {
    async sendEmail() {
      if(!this.email){
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: "请输入邮箱！",
          color: "negative",
        });
        return;
      }
      if(!this.msg) {
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: "请输入内容！",
          color: "negative",
        });
        return;
      }

      // if(!this.$store.state.user.info) {
      //   this.$q.notify({
      //     position: "top",
      //     timeout: 1500,
      //     message: "请登录！",
      //     color: "negative",
      //   });
      //   return;
      // }

      var verify = /^\w[-\w.+]*@([A-Za-z0-9][-A-Za-z0-9]+\.)+[A-Za-z]{2,14}/;
      if (!verify.test(this.email)) {
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: "请输入正确的邮箱！",
          color: "negative",
        });
        return;
      }

      if(this.sending) {
        return;
      }
      this.sending = true;
      const sendEmail = await this.$store.dispatch("home/sendEmail", {
        email: this.email,
        msg: this.msg,

      })

      this.sending = false;
      if (sendEmail.success) {
        this.email = '';
        this.msg = '';

        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: this.$t("home.sendSuccessfully"),
          color: "positive",
        });
      } else {
        this.$q.notify({
          position: "top",
          timeout: 1500,
          message: this.$t("home.sendFailed"),
          color: "negative",
        });
      }
    },
  },
};

