      if (scrollTop > 0 && scrollTop - 30 > this.scrollDomTop) {
        // console.log("滚动大于0的时候要做的操作")
        this.scrollDomClass = true;
        // this.scrollDomLeft = this.$refs.scrollDom.offsetLeft;
